import styled from "styled-components";

const RegisterContainer = styled.div`
  margin: 0 !important;
  justify-content: center;
  background-color: white;
  flex-direction: column;
  height: calc() (var(--mobile-screen) + 40vh);
  font-size: 4rem;
`;

const RegisterGNB = styled.h1``;

const StaticInfos = styled.div`
  width: 100%;
  background-color: red;
  margin: 0rem;
  display: flex;
  flex-direction: column;
  padding: 4rem;
`;

const StaticInfo = styled.span``;

const UpdateForm = styled.form``;

const UpdateHeader = styled.h1``;

const UpdateLabel = styled.label``;

const UpdateInput = styled.input``;

const UpdateBTN = styled.button``;

function Register() {
  return (
    <div id="GlobalContainer">
      <RegisterContainer className="container">
        <RegisterGNB className="gnb">회원가입</RegisterGNB>
        <UpdateForm className="form">
          <br />
          <UpdateLabel className="label">
            이메일:
            <br />
            <UpdateInput className="input" type="text" />
          </UpdateLabel>
          <hr />
          <UpdateLabel className="label">
            이전 비밀번호:
            <br />
            <UpdateInput className="input" type="text" />
          </UpdateLabel>
          <hr />

          <UpdateLabel className="label">
            비밀번호 확인:
            <br />
            <UpdateInput className="input" type="text" />
          </UpdateLabel>
          <hr />
          <UpdateLabel className="label">
            전화번호:
            <br />
            <UpdateInput className="input" type="text" />
          </UpdateLabel>

          <UpdateBTN className="submit_btn" type="submit">
            회원가입
          </UpdateBTN>
        </UpdateForm>
      </RegisterContainer>
    </div>
  );
}

export default Register;
